description:
Fathom: Kiani Vol. 1: Blade of Fire

English | CBR | 5 Issues

Genre: Action/Adventure, Fantasy, Science Fiction

Written by Vince Hernandez
Art by Marcus To

Collects Fathom: Kiani #0-4.

Kiani, Fathom's popular Elite Blue warrior, embarks on a journey of her own in search for answers. Following the tragic death of her close friend and fellow soldier Brande, Kiani finds herself lost in despair amidst the aftermath of war. After learning a shocking truth about her childhood, Kiani decides to search deeper for the missing pieces of her origin, and the adventure she finds will shape her future for better or for worse.

